values:
I have just been informed that Chris has been childishly bitching about me to my friends behind my back. Real mature chris. It seems that hes jealous that i dont want to spend time with him anymore and is consequently turning my friends against me. So just a message to my uni friends, excluding chris, dont listen to him, he has a silver tounge and will say almost anything to get his way. Indeed i could also tell you all the asshole things hes done but i pride myself in not sinking to his level. If you no longer like me because of him, fair does, just wanted to let you know i have nothing against you...just him.&nbsp;
In other news i have been very ill lately and spent a good 20 hrs in bed yesterday, i think it was the lack of sleep from before.
gah.
